  async function usermatch(userName, usertype) {
    const typeUsers = await KV.get(usertype) ||'';
    const typeUsersArray = typeUsers.split(","); // 将返回的用户类型字符串分割成数组
    return typeUsersArray.includes(userName); // 检查用户名是否在类型用户数组中
  }
  
